import './App.css';

const iconList = ["home icon"];
function ReturnIcons() {
    return (
        <div className="navbar-icons">
            {iconList.map((classname) => (
                <i className={classname}></i>
            ))}
        </div>
    );
}
function App() {
    return (
        <div className="content">
            <div className="navbar">
                <ReturnIcons />
            </div>
        </div>
    );
}

export default App;
